export const getEmail = async()=>{

    await fetch("http://192.168.1.247:3001/api/user/home")
    .then(data => {
        let newData = data
        return {
            type:"EMAIL",
            payload: newData
        }
    })
    .catch(err=> console.log("error: ", err))


}
